import React, { FC } from "react";
type signInBtn = { btnTitle: string };
const SignInBtn: FC<signInBtn> = ({ btnTitle }) => {
  return <button className="bg-NetflixRed">{btnTitle}</button>;
};

export default SignInBtn;
